import "./css/style.css";

const Tempapp = () => {
    return(
        <>
           <div className="box">
                <div className="inputData">
                    <input
                    type="search"
                    className="inputFeild" 
                    value=""/>
                </div>
           </div>
        </>
    )
}


export default Tempapp;
